import React from "react";
import { Menu } from "semantic-ui-react";
const NavBar = () => {
  return (
    <Menu borderless fixed="top">
      <Menu.Item name="Home" />
      <Menu.Item name="Recipies" />
    </Menu>
  );
};

export default NavBar;
